import {
  Container,
  Row,
  Col,
  Alert,
  Breadcrumb,
  BreadcrumbItem,
  Card,
  CardHeader,
  CardTitle,
  CardImg,
  CardBody,
  CardFooter,
  Button
} from "shards-react";
import Head from "next/head";
import SEO from "react-seo-component";

import Layout from "../components/Layout";

// Style for the onft icons
const liStyles = {
  display: "inline!important",
  paddingLeft: "50px"
};

const oLiStyles = {
  display: "inline"
};

const ulStyles = {
  listStyleType: "none",
  paddingTop: "15px"
};

const Index = props => (
  <Layout>
    <SEO
      title="Contact | CXC Spanish Guide"
      description={
        "Contact Us. Whether you're a beginner or just looking for some refreshers, we want to express gratitue for letting us be a part of your journey."
      }
      image={""}
      pathname={"https://www.cxcspanish.com/contact"}
      siteLanguage={"en"}
      siteLocale={""}
      twitterUsername={"cxcspanish"}
    />
    <Container>
      <Breadcrumb>
        <BreadcrumbItem>
          <a href="/">Home</a>
        </BreadcrumbItem>
        <BreadcrumbItem active>Contact</BreadcrumbItem>
      </Breadcrumb>
      <Row>
        <Col sm={12} md={8} lg={8}>
          <Card>
            <CardBody>
              <CardTitle>Contact Us</CardTitle>

              <br />
              <p>
                Whether you're a beginner or just looking for some refreshers,
                we want to express gratitude for letting us be a part of your
                journey.
              </p>

              <p>
                Don't forget to read our <a href="/FAQ">FAQ</a>.
              </p>
            </CardBody>
          </Card>
        </Col>
        <Col sm={12} md={4} lg={4}>
          <div
            style={{
              position: "relative",
              paddingBottom: "56.25%",

              height: "0",
              overflow: "hidden"
            }}
          >
            <div className="mapouter">
              <div className="gmap_canvas">
                <iframe
                  width="600"
                  height="500"
                  id="gmap_canvas"
                  src="https://maps.google.com/maps?q=kingston%20jamaica&t=&z=13&ie=UTF8&iwloc=&output=embed"
                  frameBorder="0"
                  scrolling="no"
                  marginHeight="0"
                  marginWidth="0"
                ></iframe>
                Kingston, Jamaica
              </div>
              <style>
                {`.mapouter {
                                position: relative;
                                text-align: right;
                                height: 500px;
                                width: 600px;
                              }
                              .gmap_canvas {
                                overflow: hidden;
                                background: none !important;
                                height: 500px;
                                width: 600px;
                              }

                              `}
              </style>
            </div>
          </div>
        </Col>
      </Row>
    </Container>
  </Layout>
);

export default Index;
